 ## Request na API de Staging
 
 ```
 curl --location --request GET 'https://athena-api.stg.consolidacao.warren.com.br/v2/indexes' \
 --header 'Accept: text/plain' \
 --header 'Content-Type: application/json' \
 ```
 
 ## Retorno da API
 
 ``` json
{
    "result": [
        {
            "indexId": 1,
            "name": "CDI",
            "identifier": "cdi"
        },
        {
            "indexId": 2,
            "name": "Ibovespa",
            "identifier": "ibov"
        },
        {
            "indexId": 3,
            "name": "Dólar",
            "identifier": "dolar"
        },
        {
            "indexId": 4,
            "name": "IPCA",
            "identifier": "ipca"
        }
    ],
    "httpStatusCode": 200
}
 ```
